Write a Groovy program that uses a linked list data structure to implement a stack. The program should be able to perform the following stack operations: push (add an element to the top of the stack), pop (remove and return the top element from the stack), and peek (return the top element without removing it). Use object-oriented programming principles to design your implementation. Include comments in your code to explain your design decisions and the reasoning behind them.

Solution:``` 
class Stack<T> {
    private Node<T> top;

    class Node<T> {
        private T data;
        private Node<T> next;

        public Node(T data) {
            this.data = data;
        }
    }

    public void push(T data) {
        Node<T> newNode = new Node<T>(data);

        if (this.top == null) {
            this.top = newNode;
        } else {
            newNode.next = this.top;
            this.top = newNode;
        }
    }
